"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?6/55/7034/abstract/1\">",
"      Cortes J, Kantarjian H. How I treat newly diagnosed chronic phase CML. Blood 2012; 120:1390.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?6/55/7034/abstract/2\">",
"      Baccarani M, Cortes J, Pane F, et al. Chronic myeloid leukemia: an update of concepts and management recommendations of European LeukemiaNet. J Clin Oncol 2009; 27:6041.",
"     </a>",
"    </li>",
