"    Normal citrated rapid TEG tracing with normal ACT, R time, K time, alpha angle, MA, G, and LY30.",
"    <div class=\"footnotes\">",
"     R (reaction time): time from sample placement or activation until the tracing amplitude reaches 2 mm; K (clot formation time): time elapsed between the R-time and the point where the tracing amplitude reaches 20 mm; alpha angle: angle between the middle line of the tracing and a tangential line to the developing \"body\" of the tracing; MA (maximal amplitude): the maximal amplitude reached after clot initiation; G: a calculated measure of total clot strength based on amplitude; LY30: the amount of clot lysis detected 30 minutes after the maximal amplitute (MA) is reached; SP (split point): time from sample placement (or activation with an exogenous procoagulant) until the earliest detectable resistance.",
